description:
Lily and Mugur are so different. Lily is sensitive, gentle and shy while Mugur is a hot-headed, dominant macho. When these two perspective, these two worlds collides, a catastrophe is imminent. Guess our surprise when instead of a scandalous meeting this whole things turn into a passionate romance... it is a beautiful collision indeed.

